Enel's services are designed for your everyday comfort. With MyEnel you easily manage your electricity or gas contracts, ask for help in any problem and discover the Enel world, directly from your mobile phone.
MyEnel is a dynamic application through which you can:
•	Manage more places for electricity and natural gas consumption;
•	Forward the electricity or gas index and track consumption trends more easily;
•	View the last 12 invoices issued and payments;
•	Pay the bills for one or more places of consumption;
•	Save data card for easier and faster payments;
•	Modify your contact information;
•	Choose to receive the invoice attached to the email;
•	Setting up notifications and promotional messages;
•	Find out the balance of the invoice without being authenticated in the application;
•	Get quick answers to your questions and suggestions.
Your feedback is very important to us which is why we are waiting for your recommendations and suggestions on the email address: mobile.ro@enel.com.

Parcheaza rapid, plateste usor si salveaza timp cu "Parking Bucuresti".
„Parking Bucuresti” te ajuta:
- sa identifici locurile disponibile din cea mai apropiata parcare;
- sa afli traseul optim pana la parcarea aleasa;
- sa platesti online cu cardul bancar sau prin SMS la 7458 (mesajul trebuie sa cuprinda codul parcarii afisat pe panourile din fiecare parcaj, spatiu liber, numarul masinii, spatiu liber, numarul de ore de stationare. Exemplu pentru 1 ora de parcare: P0123 B123OZB 1).

„Parking Bucuresti” este o aplicatie gratuita oferita de Compania Municipala Parking Bucuresti S.A. Autorii nu pot fi facuti responsabili de nicio consecinta ce decurge din folosirea aplicatiei, iar descarcarea ei constituie acordul pentru aceasta conditie de utilizare.

